import React from 'react'
import Card from './Card'

export default function List({items}) {
    // console.log(typeof(items));
    console.log(items);


    return (
        <div>
            { items.map(item=> {
                return <Card img={item} key={item.length}/>
            })}

        </div>
    )
}
